import * as React from 'react';
import {
  List,
  ListItem,
  ListItemAvatar,
  Avatar,
  Typography,
  Box,
  Paper,
  Container,
  useTheme,
  useMediaQuery,
} from '@mui/material';

// Angepasste Hilfsfunktion zur Datenerstellung (ohne Form)
const createTeamData = (
  rank,
  logoColor,
  name,
  // formString entfernt
  played,
  won,
  drawn,
  lost,
  goalsFor,
  goalsAgainst,
  points
) => {
  const goalDifference = goalsFor - goalsAgainst;
  return {
    rank,
    logoColor,
    name,
    // form entfernt
    played,
    won,
    drawn,
    lost,
    goalsFor,
    goalsAgainst,
    goalDifference,
    points,
  };
};

// Angepasste Teamdaten (ohne FormString)
const teamData = [
  createTeamData(1, '#D32F2F', 'Rakete Freiburg', 5, 4, 1, 0, 27, 6, 9),
  createTeamData(2, '#757575', 'Die 2. Wahl', 4, 4, 0, 0, 18, 7, 8),
  createTeamData(3, '#5D4037', 'Lokomotive Littenweiler', 6, 3, 1, 2, 29, 11, 7),
  createTeamData(4, '#C2185B', 'Red Sea', 3, 3, 0, 0, 15, 8, 6),
  createTeamData(5, '#00796B', 'Wurschtwecklebombers', 3, 3, 0, 0, 14, 7, 6),
  createTeamData(6, '#FBC02D', 'Latinos Freiburg', 5, 2, 2, 1, 16, 16, 6),
  // ... Du kannst hier bei Bedarf weitere Teams hinzufügen
];

// FormDisplay Komponente wurde entfernt

const TeamList = ({ title }) => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <Container maxWidth="md" sx={{ my: 4, px: isMobile ? 1 : 2 }}>
      <Typography
        variant={isMobile ? 'h5' : 'h4'}
        sx={{
          mb: 2,
          mt: 2,
          color: '#00A99D',
          fontWeight: 700,
          fontFamily: 'comfortaa',
          textAlign: 'center',
          textTransform: 'uppercase',
          letterSpacing: '0.1em',
        }}
      >
        {title}
      </Typography>
      <Paper
        sx={{
          backgroundColor: '#111',
          borderRadius: theme.shape.borderRadius,
          border: `1px solid ${theme.palette.grey[800]}`,
        }}
      >
        <List disablePadding>
          {teamData.map((team, index) => (
            <ListItem
              key={team.name}
              sx={{
                py: isMobile ? 1.5 : 2,
                px: isMobile ? 1.5 : 2.5,
                borderBottom: index === teamData.length - 1 ? 'none' : `1px solid ${theme.palette.grey[800]}`,
                '&:hover': { backgroundColor: 'rgba(255,255,255,0.05)' },
                display: 'flex', // Sicherstellen, dass ListItem ein Flex-Container ist
                alignItems: 'center', // Vertikale Zentrierung für Avatar und Textblock
              }}
            >
              {/* Avatar bleibt unverändert */}
              <ListItemAvatar sx={{ minWidth: isMobile? 45 : 56 }}>
                <Avatar
                  alt={`${team.name} Logo`}
                  sx={{
                    width: isMobile ? 30 : 40,
                    height: isMobile ? 30 : 40,
                    fontSize: isMobile ? '0.8rem' : '1rem',
                    color: theme.palette.getContrastText(team.logoColor || theme.palette.grey[700]),
                    backgroundColor: team.logoColor || theme.palette.grey[700],
                    fontFamily: 'comfortaa',
                    fontWeight: 'bold',
                  }}
                >
                  {team.name.substring(0, 1).toUpperCase()}
                </Avatar>
              </ListItemAvatar>

              {/* Textblock für Name, Rang und Punkte */}
              <Box sx={{ flexGrow: 1 }}>
                <Typography
                  variant={isMobile ? 'body1' : 'h6'}
                  component="div"
                  sx={{
                    fontFamily: 'comfortaa',
                    color: theme.palette.grey[100],
                    fontWeight: 'bold',
                    fontSize: isMobile ? '0.9rem' : '1.1rem',
                    lineHeight: 1.3,
                  }}
                >
                  {team.name}
                </Typography>
                <Typography
                  variant="body2"
                  sx={{
                    fontFamily: 'comfortaa',
                    color: theme.palette.grey[400],
                    fontSize: isMobile ? '0.7rem' : '0.8rem',
                    mt: 0.25,
                  }}
                >
                  Rang: {team.rank} | Punkte: {team.points}
                </Typography>
              </Box>

              {/* FormDisplay und die dazugehörigen Boxen wurden entfernt */}
            </ListItem>
          ))}
        </List>
      </Paper>
    </Container>
  );
};

export default TeamList;
